var _hoisted_2 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"container\"><br><table width=\"680\" border=\"0\" align=\"center\"><tr><td><table width=\"680\" height=\"37\" border=\"0\" background=\"/assets/cimages/bg_1.jpg/\"><tr><td><span><strong>Что такое технический анализ?</strong></span></td></tr></table><br><p><strong>&quot;Technical analysis&quot;:-</strong> это отраслевой термин, который чаще всего звучит намного сложнее, чем фактический процесс. На самом деле, это следует называть «анализом цен», так как это было бы более точным описанием. Посредством использования картографических данных трейдеры по всему миру анализируют свой рынок выбора. Цель: определить будущее движение цены. Средства: понимание закономерностей движения цены прошлого.<strong><u></u></strong><br> График ценовых движений создает визуальное перетягивание каната между покупателями и продавцами. Подавляющее большинство технических трейдеров на рынке Forex сосредотачивают свое внимание на данных свечей, методе построения графиков, который предлагает визуальную интерпретацию максимума, минимума, открытия и закрытия цены валюты в течение определенного периода времени. <br> В сочетании с различными формами распознавания образов (которые будут рассмотрены позже), подсвечники дают трейдерам визуальный взгляд на прошлые цены и тренды рынка. Анализ этих исторических данных для прогнозирования будущих цен является процессом, известным как «технический анализ». Обратите внимание, как ценовые модели, сформированные на следующем графике, имеют тенденцию повторяться; технические трейдеры пытаются определить закономерности такого рода и соответственно основывают свои сделки. <u></u></p><p align=\"center\"><img src=\"/assets/cimages/untitledwsdwd.jpg/\"></p><table width=\"680\" height=\"37\" border=\"0\" background=\"/assets/cimages/bg_1.jpg/\"><tr><td><span><strong>Почему технический анализ работает?</strong></span></td></tr></table><br><p>Технический анализ часто развеивается как миф, даже глупое поручение. Есть те, кто считает, что движение цены совершенно случайно и совершенно непредсказуемо. Правда, технический анализ никогда не бывает точной наукой (предсказывать будущее никогда не бывает). Тем не менее, истинным дураком будет тот, кто игнорирует силу технического анализа, особенно на рынке Форекс. <br>       Анализ ценовых моделей на самом деле очень похож на анализ поведения человека. В то время как люди иногда могут быть непредсказуемыми по своей природе, люди обычно считаются существами привычки. Средний человек придерживается определенных парадигм, парадигм, которые редко нарушаются. Вы сначала чистите зубы или душ? Вы расчесываете волосы до или после бритья? Дело в том, что, если перед тем, как выйти из дома на работу, нужно соблюдать распорядок дня обычного человека, его поведение может показаться случайным или бесполезным. Однако, если бы человек наблюдал одного и того же человека день за днем, в течение относительно короткого промежутка времени не составило бы труда описать утреннюю рутину этого человека. Фактически, в девяти случаях из десяти вы, вероятно, сможете с внушительной точностью предсказать, как ваше наблюдаемое существо будет готовиться к своему дню, возможно, даже до минуты. <br>     Рынок Форекс также является привычкой. Анализ ценового движения эффективен, потому что прошлое может научить нас, как люди (реальный живой и дышащий организм этого рынка) будут реагировать на определенные ситуации. История повторяется. Технический анализ предлагает трейдеру Forex определенный уровень ожидания при рассмотрении будущих ценовых движений. В некотором смысле, точный технический анализ является истинным преимуществом трейдера. Не существует хрустального шара для предсказания будущего рынка, хотя есть ключи к пониманию закономерностей прошлого, настоящего и будущего.</p><table width=\"680\" height=\"37\" border=\"0\" background=\"/assets/cimages/bg_1.jpg/\"><tr><td><span><strong>Когда не работает технический анализ?</strong></span></td></tr></table><br><p>Технический анализ терпит неудачу, когда трейдеры не учитывают основы. Зачем упоминать фундаментальный анализ при объяснении технического анализа? Просто, один не работает без другого. Фундаментальные факторы, такие как политические события, повышение процентных ставок, уровень безработицы и так далее, будут влиять на рынок Forex более существенно, чем, возможно, любой другой рынок. Фундаментальные факторы часто являются движущей силой основных ценовых движений. Трейдер, сосредоточенный на техническом анализе, не может игнорировать Nonfarm Payroll в первую пятницу месяца и ожидать, что его или ее технические показатели будут такими же точными, как и днем ранее. Обратите внимание на движение цены, показанное на следующем рисунке; вскоре после Nonfarm Payroll ценовые реакции были дикими; в такие времена на технический анализ нельзя рассчитывать.</p><div align=\"center\"><img src=\"/assets/cimages/untitledasd.jpg/\"></div><p>Чисто технические трейдеры понимают, что определенные политические факторы выбрасывают все другие ценовые прогнозы в окно. </p><div align=\"left\"></div></td></tr></table></div>", 1);
